            Value: -1,
            State: false
        },
        {
            id:6, 
            Answer: "공매도", 
            Value: 1,
            State: false
        },
        {
            id:7, 
            Answer: "ROA", 
            Value: 1,
            State: false
        },
        {
            id:8, 
            Answer: "FPS", 
            Value: -1,
            State: false
        },
        {
            id:9, 
            Answer: "인덱스", 
            Value: 1,
            State: false
        },
        {
            id:10, 
            Answer: "MTS", 
            Value: 1,
            State: false
        },
        {
            id:11,
            Answer: "BTS", 
            Value: -1,
            State: false
        },
        {
            id:12,
            Answer: "증거금", 
            Value: 1,
            State: false
        },
        {
            id:13,
            Answer: "코스피", 
            Value: 1,
            State: false
        },
        {
            id:14, 
            Answer: "반모", 
            Value: -1,
            State: false
        },
        {
            id:15,
            Answer: "IPO", 
            Value: 1,
            State: false
        }
    ]
}

function MulSelection({answer, value}) {
    return(
        <li className={'ell-comp'}>{answer}</li>
    )
}

function Comp({ page, question, answers}) {
    return (
        <div>
            <h3>{ page }</h3>
            <h1> { question }</h1>
            {answers.map(answer => (
                <MulSelection answer= {answer.Answer} value={answer.Value} />
            ))}
        </div>
    );
}

function Test() {
    return (
        <div>
            {QnA_5.map( page => (
                <Comp page={page.page} question={page.Question} answers={page.Answers}/>
            ))}
            {/* {console.log({QnA})} */}
        </div>
    );
}

export default Test;
